Yes, you **can get the `FileBrowser` instance from the `JupyterFrontEnd` object**, but not directly—you get it from the **shell** via `widgets` or more robustly from the **filebrowser plugin token** if you're in an extension.

Here are your two best options:

---

### ✅ **Option 1: (Preferred) Use the FileBrowser token**

If you're writing a JupyterLab extension, **inject** the `IFileBrowserFactory` token:

```ts
import { IFileBrowserFactory } from '@jupyterlab/filebrowser';

const activate = (
  app: JupyterFrontEnd,
  browserFactory: IFileBrowserFactory
) => {
  const fileBrowser = browserFactory.defaultBrowser;
  const currentPath = fileBrowser.model.path;
  console.log('Current path:', currentPath);
};
```

Register your extension like:

```ts
const extension: JupyterFrontEndPlugin<void> = {
  id: 'your-extension-id',
  requires: [IFileBrowserFactory],
  activate,
  autoStart: true
};
```

---

### 🛠️ **Option 2: Get FileBrowser from the shell (less robust)**

If you don’t want to (or can’t) use `IFileBrowserFactory`, you can try scanning the shell’s widgets:

```ts
import { FileBrowser } from '@jupyterlab/filebrowser';

const fileBrowser = Array.from(app.shell.widgets('left'))
  .find(widget => widget instanceof FileBrowser) as FileBrowser;

if (fileBrowser) {
  const currentPath = fileBrowser.model.path;
  console.log('Current path:', currentPath);
}
```

This is more brittle—e.g., it might break if JupyterLab’s internal structure changes or if other file browsers are added.

---

### Summary

| Method                         | Pros                     | Cons                      |
|-------------------------------|--------------------------|---------------------------|
| `IFileBrowserFactory`         | Reliable, clean          | Only available in extensions |
| `app.shell.widgets('left')`   | Works outside extension   | Brittle and less safe     |

