The type of `defaultBrowser` on `IFileBrowserFactory` is:

```ts
FileBrowser
```

### Full Type:
```ts
import { FileBrowser } from '@jupyterlab/filebrowser';

const browser: FileBrowser = browserFactory.defaultBrowser;
```

---

### Background:
- `defaultBrowser` is an instance of the main `FileBrowser` used in JupyterLab’s file panel (usually on the left side).
- It includes:
  - `model: FileBrowserModel`
  - `widget.node: HTMLElement`
  - File operations: `createNew`, `delete`, `rename`, etc.
  - Access to current path: `model.path`
  - Signals like `pathChanged`, `fileChanged`

---

### Example usage:
```ts
import { IFileBrowserFactory } from '@jupyterlab/filebrowser';

const activate = (
  app: JupyterFrontEnd,
  browserFactory: IFileBrowserFactory
) => {
  const fileBrowser = browserFactory.defaultBrowser; // type: FileBrowser
  const currentDir = fileBrowser.model.path;

  console.log('Current file browser path:', currentDir);
};
```

