Ah — that error reveals a subtlety: **`FileBrowser` _is_ the browser** — there is no `.browser` property because `FileBrowser` itself **is** the browser.

So, the correct line is simply:

```ts
const fileBrowser = browserFactory.tracker.currentWidget;
```

### Why the confusion happens
- `IFileBrowserFactory` has a `createFileBrowser()` method that returns an object with a `.browser` property.
- But when you get the widget from the **tracker**, you're getting the actual `FileBrowser` widget, which already includes everything (methods, model, etc.).

### Accessing its current path
If you're trying to get the current folder, for example:

```ts
const path = fileBrowser?.model.path;
```

Or to create a new untitled file in that directory:

```ts
const model = fileBrowser?.model;
if (model) {
  const newFile = await model.manager.newUntitled({ path: model.path, type: 'file' });
  console.log('Created file:', newFile.path);
}
```

